// ๅญๅจๆชๅพ็ถๆ็ๅจๅฑๅ้
var screenshotData = null;
var screenshotStatus = 'ready'; // 'ready', 'processing', 'success', 'error'

/**
 * ่ทๅๅฝๅๆชๅพ็ปๆ๏ผๅๆญฅๆนๆณ๏ผ
 * @return {string} base64ๅพ็ๆฐๆฎๆ้่ฏฏไฟกๆฏ
 */
function getScreenshot() {
  if (screenshotStatus === 'processing') return 'STATUS:processing';
  if (screenshotStatus === 'error') return 'ERROR:' + screenshotData;
  return screenshotData || 'STATUS:no_data';
}

/**
 * ๆง่กๅจๅฑๆชๅพ๏ผ้ซๆธไผๅ็๏ผ๏ผ็ป่ฟ noscript ๅ display:none ็ๅ็ด
 */
function captureScreenshot() {
    if (screenshotStatus === 'processing') return;
    
    screenshotStatus = 'processing';
    screenshotData = null;
    
    const dpr = 1.5
    const options = {
      scale: dpr,
      logging: false,
      useCORS: true,
      allowTaint: false,
      backgroundColor: '#fff',     // ็ฝ่ฒ่ๆฏ
      letterRendering: true,       // ไผๅๆๅญๆธฒๆ
      removeContainer: true,       // ๆธ็ไธดๆถๅฎนๅจ
      
      // ๅณ้ฎ้็ฝฎ๏ผๅฟฝ็ฅ noscript ็ๅ็ด
      ignoreElements: (element) => {
        return element.tagName.toLowerCase() === 'noscript';
      },
    };
    
    html2canvas(document.body, options)
      .then(canvas => {
        screenshotData = canvas.toDataURL('image/png', 0.92); // 92%่ดจ้
        screenshotStatus = 'success';
      })
      .catch(error => {
        //alert(error)
        screenshotData = error.message;
        screenshotStatus = 'error';
      });
}